import React from 'react';
import SceneCard from './SceneCard';
import RoomCard from './RoomCard'; // Import RoomCard component

// Import Bootstrap CSS
import 'bootstrap/dist/css/bootstrap.min.css';

// Import your logo image
import logo from './assets/images/'; // Replace './logo.png' with the actual path to your logo image

const HomePage = () => {
  return (
    <div>
      <img src={logo} alt="Logo" className="mx-auto d-block" /> {/* Logo image */}
      <SceneCard />
      <h2 className="text-center">Rooms & Spaces</h2>
      <div className="container">
        <div className="row">
          <div className="col">
            <RoomCard />
          </div>
          <div className="col">
            <RoomCard />
          </div>
          <div className="col">
            <RoomCard />
          </div>
        </div>
        <div className="row">
          <div className="col">
            <RoomCard />
          </div>
          <div className="col">
            <RoomCard />
          </div>
          <div className="col">
            <RoomCard />
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
